import React from 'react';
import classes from './posts-page.module.css';
import Post from '../post/post';
import { Contextt } from '../../app2';

export default () => {
    return (
    <div className={classes.posts}> 
        <h1>Posts</h1>
        <Contextt.Consumer>
        {
            (obj) => {
                return(obj.posts.map((v) => 
                    <Post key={v.postId} id={v.postId}
                        author={v.author}
                        date={v.date}
                        title={v.title}
                        disc={v.shordDesc}
                        comments={v.comments}
                    />
                ));
            }
        }
        </Contextt.Consumer>
    </div>
    );
}
